import { Fragment } from "react";
import { GlobalStyle } from "styled-components";

function MyApp({ Component, pageProps }) {
	return (
		<Fragment>
			<GlobalStyle />
			<Component {...pageProps} />
		</Fragment>
	);
}
export default MyApp;
